// ApexLexerInit initializes any static state used to implement ApexLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewApexLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func ApexLexerInit() {
	staticData := &ApexLexerLexerStaticData
	staticData.once.Do(apexlexerLexerInit)
}

// NewApexLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewApexLexer(input antlr.CharStream) *ApexLexer {
	ApexLexerInit()
	l := new(ApexLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &ApexLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "ApexLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

